Ищу для себя стартап, молодой продукт или продуктовую команду. Готов тестировать вручную, выстраивать прозрачные процессы, брать ответственность за сроки и качество. Готов к потоку новой информации, системному отсутствию документации (буду писать сам), срочным релизам и ограниченному времени на тестирование;Я сторонник мнения, что тестирование — это не прохождение тест-кейсов, а прозрачные процессы разработки и релизов. Системная работа над уменьшением числа ошибок всей командой.Софт скилы:— Яркий, открытый и системный парень с реактивным складом ума;— Умею обрабатывать большие потоки новой информации (сторонник хорошей вики и zero inbox);— Гибкий в убеждениях и open mind, хорошо справляюсь со стрессом;Хард скилы:— Понимаю клиент-серверную архитектуру, HTTP и SQL;— Уверенно работаю с гитом;— Я довольно гибок в плане инструментов, в последнее время вики пишу в Notion, тест планы в Miro;— Языки программирования: пишу на нативном JavaScript;— Могу развернуть имейдж приложения в Docker (но досконально не знаю как он работает);— Уверенно работаю с Charles, Postman, Xcode, Android Studio;— Работал со стеком ELK и оркестрарием Ansible;— Атвотесты: небольшой опыт написания тестов на JavaScript на Playwright. Запуск автотестов на Python. Контроль покрытия автотестами;Пет-проджекты:— Клиент для БД и простая postgres БД: http://metabase.dolnikov.ru/;— Преподаю https://solvery.io/ru/mentor/german_dolnikov;— Пишу про личный бюджет https://dolnikov.ru/blog/all/lichny-byudzhet/;— Пишу блог на https://dolnikov.ru/blog/Кредо: главное не всё знать, а загуглить на английском!Играю в бильярд, веду киноклуб, слушаю подкаст «Деньги пришли» и читаю канал Фёдора Борщева. Смотрю твич по героям 3 🚀Ищу для себя стартап, молодой продукт или продуктовую команду. Готов тестировать вручную, выстраивать прозрачные процессы, брать ответственность за сроки и качество. Готов к потоку новой информации, системному отсутствию документации (буду писать сам), срочным релизам и ограниченному времени на тес